import React, { useState } from "react";
import Barredown from "./components/Barredown";

import { Taille, Sauces } from "./components/Themenu";

const MyTacos = () => {
  return (
    <div className="relative myFund container text-center flex-col rounded-xl  bg-white h-3/5 w-2/4 ">
      <h1 className="text-5xl uppercase font-bold mt-5">Compose ton tacos</h1>
      <h2 className="text-5xl uppercase font-bold mt-10  ">
        <span className="h-5 w-5 px-4 bg-yellow-300 text-white">1</span> TAILLE
      </h2>

      <div>
        <div>
          <label htmlFor="xxl">XXL</label>
          <input type="radio" name="tacos" id="xxl" />
        </div>

        <div>
          <img
            src="./img/sizeTacos/sizeTacos.png"
            className="w-20 h-20"
            alt="ok"
          />
          <label htmlFor="xl">XL</label>
          <input type="radio" name="tacos" id="xl" />
        </div>
      </div>

      {/* <Barredown /> */}
    </div>
  );
};

export default MyTacos;
